data_model.html.body:
Signal K Data Model
Formats
Signal K defines two data formats, full and delta, for representing and transmitting data.
In addition the 'sparse'
format is the same as the full format, but doesn't contain a full tree, just parts of the full tree.
Full format
The simplest format is the full format, which is the complete Signal K data model  as a JSON string.
{
  "vessels": {
    "urn:mrn:signalk:uuid:c0d79334-4e25-4245-8892-54e8ccc8021d": {
      "version": "0.1",
      "name": "motu",
      "mmsi": "2345678",
      "source": "self",
      "timezone": "NZDT",
      "navigation": {
        "state": {
          "value": "sailing",
          "source": "self",
          "timestamp": "2014-03-24T00:15:41Z"
        },
        "headingTrue": {
          "value": 2.3114,
          "$source": "nmea0183-1.II",
          "sentence": "HDT",
          "timestamp": "2014-03-24T00:15:41Z"
        },
        "speedThroughWater": {
          "value": 2.556,
          "$source": "n2k-1.160",
          "pgn": 128259,
          "timestamp": "2014-03-24T00:15:41Z"
        },
        "position": {
          "longitude": 23.53885,
          "latitude": 60.0844,
          "$source": "nmea0183-2.GP",
          "timestamp": "2014-03-24T00:15:42Z",
          "sentence": "GLL"
        }
      }
    }
  }
}

The message is UTF-8 ASCII text, and the top-level attribute(key) is always "vessels". Below this level is a list of
vessels, identified by their MMSI number or a generated unique id. There may be many vessels, if data has been received
from AIS or other sources. The format for each vessel's data uses the same standard Signal K structure, but may not have
the same content, i.e. you won't have as much data about other vessels as you have about your own.
The values are always SI units, and always the same units for the same key. I.e. speedOverGround is always meters per
second, never knots, km/hr, or miles/hr. This means you never have to send 'units' with data, the units are specific for
a key, and defined in the data schema. A simplified version of the JSON schema with the units is available in Keys Reference in Appendix A.
The ordering of keys is also not important, they can occur in any order. In this area Signal K follows normal JSON
standards.
The full format is useful for backups, and for populating a secondary device, or just updating all data, a kind of 'this
is the current state' message.
However sending the full data model will be wasteful of bandwidth and CPU, when the majority of data does not change
often. So we want to be able to send parts of the model (i.e. parts of the hierarchical tree).
Sparse format
The sparse format is the same as the full format but only contains a limited part of the tree. This can be one or more
data values.
{
  "vessels": {
    "self": {
      "navigation": {
        "position": {
          "latitude": -41.2936935424,
          "longitude": 173.2470855712
        }
      }
    }
  }
}

Mix and match of misc values are also valid:
{
  "vessels": {
    "self": {
      "navigation": {
        "courseOverGroundTrue": {
          "value": 11.9600000381
        },
        "position": {
          "latitude": -41.2936935424,
          "longitude": 173.2470855712,
          "altitude": 0
          }
        }
      }
    }
  }
}

This mix of any combination of values means we don't need to create multiple message types to send different
combinations of data. Just assemble whatever you want and send it. When parsing an incoming message a device should skip
values it has no interest in, or doesn't recognise. Hence we avoid the problem of multiple message definitions for the
same or similar data, and we avoid having to decode multiple messages with fixed formats.
Delta format
While building the reference servers and clients it was apparent that a third type of message format was useful. This
format specifically sends changes to the full data model. This was useful for a number of technical reasons, especially
in clients or sensors that did not hold a copy of the data model.
The format looks like this (pretty printed):
{
    "context": "vessels.urn:mrn:imo:mmsi:234567890",
    "updates": [{
        "source": {
            "type": "NMEA2000",
            "src": "017",
            "pgn": 127488,
            "label": "N2000-01.017"
        },
        "timestamp": "2010-01-07T07:18:44Z",
        "values": [{
            "path": "propulsion.0.revolutions",
            "value": 16.341667
        }, {
            "path": "propulsion.0.boostPressure",
            "value": 45500.0
        }]
    }]
}

In more detail we have the header section:
{
  "context": "vessels.urn:mrn:imo:mmsi:234567890",
  "updates": [
    ...data goes here...
  ]
}

A delta message can be recognised from the other types by the topmost level having updates property.
updates is the only required property.
If context is missing it is assumed that the data is related to the self context.
Context is a path from the root of the full tree to the container object, which for vessel related data must refer to the vessel directly under vessels.
The delimiter in the context path is . (period).
In this case the context is vessels.urn:mrn:imo:mmsi:234567890.
All subsequent data is relative to that location.
The updates holds an array (JSON array) of updates, each of which has a source and a JSON array of values.
{
  "source": {
    "device": "/dev/actisense",
    "src": "115",
    "pgn": "128267"
  },
  "timestamp": "2014-08-15-16:00:00.081",
  "values": [
    {
      "path": "navigation.courseOverGroundTrue",
      "value": 2.971
    },
    {
      "path": "navigation.speedOverGround",
      "value": 3.85
    }
  ]
}

An update has a single source value and it applies to each of the values items.
In cases where you can get data from only a single source the source may be omitted and the receiver may fill it in when multiplexing data from several sources.
A Signal K producer may not have access to a real time clock or UTC time.
In these cases timestamp should be omitted.
Elements in the Signal K processing chain, like a server receiving data from a producer, should fill in timestamp if it is missing in the incoming delta message.
Each value item is then simply a pair of path and value.
The path must be a leaf path: it must be a path to a leaf the of the full model.
A leaf is where the actual value of the Signal K property is and where timestamp, $source and values properties are in the full model.
The value is often a scalar - a numeric value, as in the example above, but it can also be an object.
For example a navigation.position value would be an object like {"latitude": -41.2936935424, "longitude": 173.2470855712}.
Data Quality
Data transmitted in Signal K format is assumed to be corrected for known sensor inaccuracies and miscellaneous required adjustments (like wind arrow offset), but there is no guarantee that data is accurate, or within certain bounds. Different sources will have different data quality and normal vigilance is always required.
Missing or invalid data
A sensor or gateway/server may want to send a message indicating known invalid data or the fact that the sensor is functioning but can not provide data, for example when a depth sensor has no bottom fix. In this case the value must be JSON null in the delta message and the server must return the value as a json null in the REST api.
Message Integrity
Many messaging systems specify checksums or other forms of message integrity checking. In Signal K we assume a reliable
transport will guarantee a valid message. This is true of TCP/IP and some other transports but not always the case. For
other transports (eg RS232 serial) a specific extended data format will apply, which is suited to that transport. Hence
at the message level no checksum or other tests need to be made.
Encoding/Decoding
The JSON message format is supported across most programming environments and can be handled with any convenient library.
On micro-controllers with limited RAM it is wise to read and write using streaming rather than hold the whole message in precious RAM.
There is an implementation of Signal K JSON streaming on an Arduino Mega (4K RAM) in the related Freeboard project.

data_model_multiple_values.html.body:
Multiple Values for a Key
There are two use cases for multiple data:

Multiple instances of a common device - eg two engines or multiple batteries
Multiple devices providing duplicate data - multiple values for the same Signal K key from different sensors, eg COG from both compass and gps or multiple depth sounders

Multiple instances of a common device
Some parts of the Signal K schema are device oriented.
For example in electrical domain you have the concept of multiple batteries. Each battery has multiple, common quantities like voltage, current and temperature. Here we have chosen to organise the Signal K data model hierarchy by instance: multiple batteries are represented as for example electrical.batteries.starter and electrical.batteries.house. Then underneath that prefix you have the different properties and quantities.
This organisation allows a user interface to organise the individual readings in meaningful groups and you can query all the values related to that piece of equipment via REST API.
It maintains the primary requirement that a given data value have a fixed and unique uri, but gives flexibility in the structure and complexities of data.
The same device centric organisation is used in propulsion subschema, where the most common use case is having dual engine setup with propulsion.port and propulsion.starboard.
The values starter, house, port and starboard are examples and not specified in the schema.
You are free to use application specific values within the regexp specified in the JSON schema.
Multiple devices providing duplicate data
It is quite possible for a key value to come from more than one device. eg position (lat/lon) could come from several gps enabled devices, and multiple depth sounders are not uncommon. We need a consistent way to handle this.
All the incoming values may well be valid in their own context, and it is feasible that all of them may be wanted, for instance, displaying depth under each hull on a catamaran.
Hence discarding or averaging values is not a solution, we must provide a way to store multiple values for a single measurement.
 Lets consider this for courseOverGroundTrue
If its the first value for the key, it becomes the default value and looks like this:
{
  "vessels": {
    "urn:mrn:signalk:uuid:c0d79334-4e25-4245-8892-54e8ccc8021d": {
      "uuid": "urn:mrn:signalk:uuid:c0d79334-4e25-4245-8892-54e8ccc8021d",
      "navigation": {
        "courseOverGroundMagnetic": {
          "value": 3.615624078431453,
          "$source": "nmea2.II",
          "timestamp": "2017-03-04T14:58:48.000Z",
          "sentence": "VTG"
        }
      }
    }
  },
  "self": "urn:mrn:signalk:uuid:c0d79334-4e25-4245-8892-54e8ccc8021d",
  "version": "0.1.0",
  "sources": {
    "nmea2": {
      "label": "nmea2",
      "type": "NMEA0183",
      "II": {
        "talker": "II",
        "sentences": {
          "VTG": "2017-03-04T14:58:48.000Z"
        }
      }
    }
  }
}

It has come from device sources.nmea2.II, where further details can be found.
If another value with different source arrives, we add the values attribute with and values are in there - if its our preferred source (from persistent config) we auto-switch to it, otherwise we just record it. It look like this:
{
  "vessels": {
    "urn:mrn:signalk:uuid:c0d79334-4e25-4245-8892-54e8ccc8021d": {
      "uuid": "urn:mrn:signalk:uuid:c0d79334-4e25-4245-8892-54e8ccc8021d",
      "navigation": {
        "courseOverGroundMagnetic": {
          "value": 3.615624078431453,
          "$source": "nmea2.II",
          "timestamp": "2017-03-04T14:58:48.000Z",
          "sentence": "VTG",
          "values": {
            "nmea1.II": {
              "value": 3.6376152270065814,
              "sentence": "VTG",
              "timestamp": "2017-03-04T14:58:47.000Z"
            },
            "nmea2.II": {
              "value": 3.615624078431453,
              "sentence": "VTG",
              "timestamp": "2017-03-04T14:58:48.000Z"
            }
          }
        }
      }
    }
  },
  "self": "urn:mrn:signalk:uuid:c0d79334-4e25-4245-8892-54e8ccc8021d",
  "version": "0.1.0",
  "sources": {
    "nmea1": {
      "label": "nmea1",
      "type": "NMEA0183",
      "II": {
        "talker": "II",
        "sentences": {
          "VTG": "2017-03-04T14:58:47.000Z"
        }
      }
    },
    "nmea2": {
      "label": "nmea2",
      "type": "NMEA0183",
      "II": {
        "talker": "II",
        "sentences": {
          "VTG": "2017-03-04T14:58:48.000Z"
        }
      }
    }
  }
}

Update messages
When a client subscribes to navigation.courseOverGroundMagnetic, they recieve all the values held. The update message does not include the values path, the case above looks like:
{
  "context": "vessels.urn:mrn:signalk:uuid:c0d79334-4e25-4245-8892-54e8ccc8021d",
  "updates": [
    {
      "source": {
        "label": "nmea2",
        "type": "NMEA0183",
        "talker": "II"
        }
      },
      "timestamp": "2017-03-04T14:58:48.000Z",
      "values": [
        {
          "path": "navigation.courseOverGroundMagnetic",
          "value": 3.615624078431453
        }
      ]
    },
    {
      "source": {
        "label": "nmea1",
        "type": "NMEA0183",
        "talker": "II"
        }
      },
      "timestamp": "2017-03-04T14:58:47.000Z",
      "values": [
        {
          "path": "navigation.courseOverGroundMagnetic",
          "value": 3.6376152270065814
        }
      ]
    }
  ]
}
Individual updates can be distinguished by their source. 
If a client wants only the values of a single source it should subscribe to a path that includes the full path under values including the source reference key of the source. The source reference should be enclosed in square brackets:  navigation.speedThroughWater.values[n2kFromFile.43]. The client can retrieve the relevant data via REST API.
Note: The exact format of the update message is affected by the subscription policy. A policy of instant will result in changes being sent immediately, so typically one item in values per update. A policy of fixed will result in periodic updates which may contain many items in values.
The update allows grouping values by source.

subscription_protocol.html.body:
Subscription Protocol
Introduction
By default a Signal K server will provide a new WebSocket client with a delta stream of the vessels.self record, as updates are received from sources. E.g.
/signalk/v1/stream will provide the following delta stream, every time the log value changes .
{
  "context": "vessels",
   "updates": [{
      "source": {
        "pgn": "128275",
        "device": "/dev/actisense",
        "timestamp": "2014-08-15-16:00:05.538",
        "src": "115"
      },
      "values": [
        {
          "path": "navigation.logTrip",
          "value": 43374
        },
        {
          "path": "navigation.log",
          "value": 17404540
        }]
     }
     ]
}


Below we refer to WebSockets, but the same process works in the same way over any transport. E.g. for a raw TCP
connection the connection causes the above message to be sent, and sending the subscribe messages will have the same
effect as described here.

This can be a lot of messages, many you may not need, especially if vessel.self has many sensors, or other data sources. Generally you will want to subscribe to a much smaller range of data.
First you will want to unsubscribe from the current default (or you may have already connected with ws://hostname/signalk/v1/stream?subscribe=none). To unsubscribe all create an unsubscribe message with wildcards and send the message over the websocket connection:
{
  "context": "*",
  "unsubscribe": [
    {
      "path": "*"
    }
  ]
}

To subscribe to the required criteria send a suitable subscribe message:
{
  "context": "vessels.self",
  "subscribe": [
    {
      "path": "navigation.speedThroughWater",
      "period": 1000,
      "format": "delta",
      "policy": "ideal",
      "minPeriod": 200
    },
    {
      "path": "navigation.logTrip",
      "period": 10000
    }
  ]
}


path=[path.to.key] is appended to the context to specify subsets of the context.
The path value can use the wildcard *. A wildcard in the middle of a path (propulsion/*/oilTemperature) allows any value for that part and a wildcard at the end (propulsion/port/*) matches all paths beginning with the specified prefix.

The following are optional, included above only for example as it uses defaults anyway:

period=[millisecs] becomes the transmission rate, e.g. every period/1000 seconds. Default=1000
format=[delta|full] specifies delta or full format. Default: delta
policy=[instant|ideal|fixed]. Default: ideal
instant means send all changes as fast as they are received, but no faster than minPeriod. With this policy the client has an immediate copy of the current state of the server.
ideal means use instant policy, but if no changes are received before period, then resend the last known
values.eg send changes asap, but send the value every period millisecs anyway, whether changed or not.
fixed means simply send the last known values every period.


minPeriod=[millisecs] becomes the fastest message transmission rate allowed, e.g. every minPeriod/1000 seconds. This is only relevant for policy='instant' to avoid swamping the client or network.

You can subscribe to multiple data keys multiple times, from multiple apps or devices. Each app or device simply subscribes to the data it requires, and the server and/or client implementation may combine subscriptions to avoid duplication as it prefers on a per connection basis. At the same time it is good practice to open the minimum connections necessary, for instance one websocket connection shared bewteen an instrument panel with many gauges, rather then one websocket connection per gauge.
Multiple value handling in subscriptions
A subscription to a key is for all the updates to that key. If there are multiple sources generating data for that key the client will get all their updates.
If a client wants only the values of a single source it should subscribe to a path that includes the full path under values including the source reference key of the source. The source reference should be enclosed in square brackets:  navigation.speedThroughWater.values[n2kFromFile.43]. The client can retrieve the relevant data via REST API.
Single use, or intermittent data
When data is required once only, or upon request the subscribe/unsubscribe method should not be used. If the client is http capable the REST api is a good choice, or use get/list/put messages over websockets or tcp.
GET/PUT/LIST variants
The get/list/put messages work in the same way as their GET/PUT REST equivalents, returning a json result for the requested path, once only. They exist to allow REST like functionality for devices without HTTP capability.
{
  "context": "vessels.self",
  "get": [
    {
      "path": "environment.depth.belowTransducer"
    }
  ]
}

{
  "context": "vessels",
   "put": [{
      "source": {
        "pgn": "128275",
        "device": "/dev/actisense",
        "timestamp": "2014-08-15-16:00:05.538",
        "src": "115"
      },
      "values": [
        {
          "path": "navigation.logTrip",
          "value": 43374
        }]
     }
     ]
}

Use Cases and Proposed Solutions
Local boat individual instruments
A gauge-type display for just one or a few data items for the 'self' vessel should be able to specify that it only wants
those items for the self vessel.
This can be achieved by a default WebSocket connection /signalk/v1/stream?subcribe=none, then sending a JSON message:
{
  "context": "vessels.self",
  "subscribe": [
    {
      "path": "environment.depth.belowTransducer"
    },
    {
      "path": "navigation.speedThroughWater"
    }
  ]
}

The JSON format is also viable over a simple TCP or serial transport, and is therefore supported as the primary
subscription method.
Map display with all known vessel positions & directions, served over 3G cellular connection
{
  "context": "vessels.*",
  "subscribe": [
    {
      "path": "navigation.position",
      "period": 120000,
      "policy": "fixed"
    },
    {
      "path": "navigation.courseOverGround",
      "period": 120000,
      "policy": "fixed"
    }
  ]
}

The result is a delta message of the Signal K data with just position and courseOverGround branches for all known vessels, sent every 2 minutes (120 seconds) even if no data has been updated.
Position of a certain vessel, immediately it changes, but once per minute at most
{
  "context": "vessels.230029970",
  "subscribe": [
    {
      "path": "navigation.position",
      "minPeriod": 60000,
      "policy": "instant"
    }
  ]
}

The result will be delta position messages for vessel 230029970, broadcast whenever it changes, but with minimum
interval of 60 seconds. Messages are delayed to meet the minimum interval with newer messages overriding the previous
message in the buffer.

versioning.html.body:
Versioning in Signal K specification
Our versioning is based on http://snowplowanalytics.com/blog/2014/05/13/introducing-schemaver-for-semantic-versioning-of-schemas/
Most of this document is reproduced from there.
When versioning a data schema, we are concerned with the backwards-compatibility between the new schema and existing data represented in earlier versions of the schema. This is the fundamental building block of SchemaVer, and explains the divergence from Semantic Versioning.
Heres a simple formula for our SchemaVer:
Given a version number MODEL.REVISION.ADDITION-SUFFIX, increment the:

MODEL - when you make a breaking schema change which will prevent interaction with any historical data
REVISION - when you make a schema change which may prevent interaction with some historical data
ADDITION - when you make a schema change that is compatible with all historical data
SUFFIX - optional - denotes special versions or active development eg alpha-1, SNAPSHOT

The first released version of Signal K will be 1.0.0.

The current development version will then move to be 1.0.1-SNAPSHOT
The next release candidate might then be 1.0.1-alpha-1
The current development version will then move to be 1.0.2-SNAPSHOT

SNAPSHOT denotes a version under active change. If you depend on the SNAPSHOT version then every time you build your project it will have changed with what-ever was committed since last time you checked.
Let’s make SchemaVer more concrete with some examples using some (truncated and contrived) Signal K Schemas, in reverse order:
Addition
We have an existing JSON Schema, let’s call this 1.0.0:
{
  "type": "object",
  "$schema": "http://json-schema.org/draft-04/schema#",
  "id": "https://signalk.org/specification/schemas/v1/groups/communication.json#",
  "description": "Schema describing the communication child-object of a Vessel.",
  "title": "communication",
  "properties": {
      "dscAddress": {
      "type": "string",
      "description": "MMSI Callsign for VHF communication"
    }
  },
  "required": ["dscAddress"],
  "additionalProperties": false
}
Now we want to add an additional field to our schema:
{
  "type": "object",
  "$schema": "http://json-schema.org/draft-04/schema#",
  "id": "https://signalk.org/specification/schemas/v1/groups/communication.json#",
  "description": "Schema describing the communication child-object of a Vessel.",
  "title": "communication",
  "properties": {
      "dscAddress": {
      "type": "string",
      "description": "MMSI Callsign for VHF communication"
    },
    "phoneNumber": {
      "type": "string",
      "description": "Phone number of skipper",
      "example": "+64xxxxxx"
    }
  },
  "required": ["dscAddress"],
  "additionalProperties": false
}
Because our new phoneNumber field is not a required field, and because version 1.0.0 had additionalProperties set to false, we know that all historical data will work with this new schema.
Therefore we are looking at an ADDITION, and so we bump the schema version to 1.0.1.
Revision
Let’s now make our JSON Schema support additionalProperties - this constitutes another ADDITION, so we are now on 1.0.2:
{
  "type": "object",
  "$schema": "http://json-schema.org/draft-04/schema#",
  "id": "https://signalk.org/specification/schemas/v1/groups/communication.json#",
  "description": "Schema describing the communication child-object of a Vessel.",
  "title": "communication",
  "properties": {
      "dscAddress": {
      "type": "string",
      "description": "MMSI Callsign for VHF communication"
    },
    "phoneNumber": {
      "type": "string",
      "description": "Phone number of skipper",
      "example": "+64xxxxxx"
    }
  },
  "required": ["dscAddress"],
  "additionalProperties": true
}
After a while, we add a new field, callsignHf:
{
  "type": "object",
  "$schema": "http://json-schema.org/draft-04/schema#",
  "id": "https://signalk.org/specification/schemas/v1/groups/communication.json#",
  "description": "Schema describing the communication child-object of a Vessel.",
  "title": "communication",
  "properties": {
      "dscAddress": {
      "type": "string",
      "description": "MMSI Callsign for VHF communication"
    },
    "phoneNumber": {
      "type": "string",
      "description": "Phone number of skipper",
      "example": "+64xxxxxx"
    },
    "callsignHf": {
      "type": "string",
      "description": "Callsign for HF communication",
      "example": "ZL3RTH"
    }
  },
  "required": ["dscAddress"],
  "additionalProperties": true
}
Will this new schema validate all historical data? Unfortunately we can’t be certain, because there could be historical JSONs where the analyst added their own callsignHf field.
So we are effectively making a REVISION to the data schema - so we bump the version to 1.1.0 (resetting ADDITION to 0).
Model
Oh dear - we have just realized that not every-one has DSC! It should have been a VHF callsign. Here is our new JSON Schema:
{
  "type": "object",
  "$schema": "http://json-schema.org/draft-04/schema#",
  "id": "https://signalk.org/specification/schemas/v1/groups/communication.json#",
  "description": "Schema describing the communication child-object of a Vessel.",
  "title": "communication",
  "properties": {
    "callsignVhf": {
      "type": "string",
      "description": "Callsign for VHF communication",
      "example": "ZL1234"
    },
    "phoneNumber": {
      "type": "string",
      "description": "Phone number of skipper",
      "example": "+64xxxxxx"
    },
    "callsignHf": {
      "type": "string",
      "description": "Callsign for HF communication",
      "example": "ZL3RTH"
    }
  },
  "required": ["callsignVhf"],
  "additionalProperties": false
}
We have changed our MODEL - because we can have no reasonable expectation that any of the historical data can interact with this schema. That means our new version is 2.0.0
Note that we also decided to use this “reboot” of the MODEL to change additionalProperties back to false, because (as we have learnt) it will help us to avoid unnecessary REVISIONs in the future.
